const k_combinations=(t,n)=>{if(n>t.length||n<=0)return[];if(n===t.length)return[t];const e=[];if(1===n){for(let n=0;n<t.length;n++)e.push([t[n]]);return e}for(let o=0;o<t.length-n+1;o++){const r=t.slice(o,o+1),l=k_combinations(t.slice(o+1),n-1);for(let t=0;t<l.length;t++)e.push(r.concat(l[t]))}return e},combinations=t=>{const n=[];for(let e=1;e<=t.length;e++){const o=k_combinations(t,e);for(let t=0;t<o.length;t++)n.push(o[t])}return n};